import styles from './Header.module.css'
import logo from '../../../src/sun.svg'
export function Header() {
  return (
    <header>
        <div className={styles.brand}>
            <span className={styles.title}>
                Michael Vaden
            </span>
        </div>
        <button className={styles.darkmode}>
            <img src={logo}/>
        </button>
    </header>
  );
}
